import React, { useEffect, useState } from "react";

function app() {
  const [Users, setUsers] = useState([]);

  useEffect(() => {
    const getUsers = async () => {
      var users = "anny";
    };
    getUsers;
  });
  return (
    <div>
      <button type="file">browse</button>
      {users}
    </div>
  );
}

export default app;
